import React from 'react';
import styles from '../navbar/Navbar.module.css'
const Types = ({types, selectedTypeId}) => {
    return (
        <div>
            {types.map(type => (
                <div>
                    {type.name}
                </div>
            ))}
        </div>
    );
};

export default Types;
